        public void SaveTransactions(RootJsonObject rootobj)
        {
            foreach (var item in rootobj.TransactionsItems)
            {
                Transaction transaction = new Transaction();
                transaction.InvolvesWatchonly = item["involvesWatchonly"];
                transaction.Txid = item["txid"];
                transaction.Account = item["account"];
                transaction.Amount = item["amount"];
                transaction.Address = item["address"];
                transaction.Category = item["category"];
                transaction.Label = item["label"];
                transaction.Confirmations = item["confirmations"];
                transaction.Blockhash = item["blockhash"];
                transaction.Blockindex = item["blockindex"];
                transaction.Blocktime = item["blocktime"];
                transaction.Vout = item["vout"];
                transaction.Walletconflicts = item["walletconflicts"].ToObject<List<object>>();
                transaction.Time = item["time"];
                transaction.Timereceived = item["timereceived"];
                transaction.Bip125_replaceable = item["bip125-replaceable"];
                
                mDb.AddTransaction(transaction);
            }
        }

        public void FilterTransactions()
        {
            //create valid deposits and save them in a database
            List<Transaction> transactions = mDb.GetTransactions();

            foreach (var transaction in transactions)
            {
                if (transaction.IsValid())
                {
                    if (!mDb.DepositExists(transaction.Address))
                    {
                        Deposit deposit = new Deposit();
                        deposit.Address = transaction.Address;
                        deposit.Account = transaction.Account;
                        deposit.Sum = transaction.Amount;
                        deposit.Count++;

                        mDb.AddDeposit(deposit);
                    }
                    else
                    {
                        Deposit deposit = mDb.GetDepositByName(transaction.Address);
                        // category send or receive
                        // no need to change the sign the send transactions are already negative                        
                        deposit.Sum += transaction.Amount;
                        
                        deposit.Count++;
                    }
                }
            }
        }

