            List<Deposit> deposits = mDb.GetDeposits();

            IOrderedDictionary knownAccounts = Transaction.GetKnownAccounts();
            foreach (DictionaryEntry entry in knownAccounts)
            {
                foreach (var deposit in deposits)
                {
                    if (entry.Value.Equals(deposit.Address))
                    {
                        Console.WriteLine("Deposited for " + entry.Key + ": count = " + deposit.Count + " sum = " + deposit.Sum);
                        break;
                    }
                }
            }
        }

        public void ProcessDepositsWithoutReference()
        {
            List<Deposit> deposits = mDb.GetDeposits();
            double sum = 0.0;
            int count = 0;

            foreach (var deposit in deposits)
            {
                if (!Transaction.IsKnownAddress(deposit.Address))
                {
                    sum += deposit.Sum;
                    count += deposit.Count;
                }
            }

            Console.WriteLine("Deposited without reference: count = " + count + " sum = " + sum);
        }

        public void ProcessDeposits()
        {
            ProcessKnownCustomers();

            ProcessDepositsWithoutReference();

            Console.WriteLine("Smallest valid deposit: " + mDb.GetMinDeposit());

            Console.WriteLine("Largest valid deposit: " + mDb.GetMaxDeposit());
        }

        private DbInteraction mDb;
        private string mDir;
    }
